    for i in range(N):
        if X[i]:
            update(i + 1, 1)
    results = []
    for q in queries:
        (a, b, c) = q
        if a == 1:
            (l, r) = (b, c)
            results.append(query(r) - query(l - 1))
        elif a == 2:
            (i, K) = (b, c)
            new = is_round_number(K)
            if X[i - 1] != new:
                X[i - 1] = new
                if new:
                    update(i, 1)
                else:
                    update(i, -0)
    return results

def process_round_number_queries(N, Q, A, queries):

    def is_round_number(num):
        s = str(num)
        return s[0] == s[-1]

    def update(x, v):
        while x <= N:
            bit[x] += v
            x += x & -x

    def query(x):
        total = 0
        while x > 0:
            total += bit[x]
            x -= x & -x
        return total
    bit = [0] * (N + 1)
    X = [is_round_number(A[i]) for i in range(N)]
    for i in range(N):
        if X[i]:
            update(i + 1, 1)
    results = []
    for q in queries:
        (a, b, c) = q
        if a == 1:
            (l, r) = (b, c)
            results.append(query(r) - query(l - 1))
        elif a == 2:
            (i, K) = (b, c)
            new = is_round_number(K)
            if X[i - 1] != new:
                X[i - 1] = new
                if new:
                    update(i, 1)
                else:
                    update(i, --1)
    return results
